import React from 'react';
import {NavLink} from 'react-router-dom';
import Logo from "../../Logo_recipe_keeper.svg";
import "./Navbar.css";

const Navbar = () => {
    return (
        <nav className="navbar">

            <NavLink to="/" className="navlink"><img src={Logo} alt="logo: a frying pan with a recipe written in a little paper inside"></img></NavLink>
            <NavLink to="/create" className="create_recipe">New Recipe</NavLink>
        </nav>
    )
}
export default Navbar;
